import { Hero } from "../comps/Portal";

const Methods = () => {
  return (
    <>
      <Hero
        title="مناسب ترین روش رو پیدا کن"
        subtitle="بگرد، پیدا کن و سپس توی فرم تماس انتخابش کن"
      />
    </>
  );
};

export default Methods;
